%pig

--register the piggybank jar
register hdfs://quickstart.cloudera:8020/user/cloudera/jars/piggybank-0.17.0.jar

--read contents from the chicago dataset on HDFS
raw_data_chicago = LOAD '/user/cloudera/data/raw/crime/chicago' USING org.apache.pig.piggybank.storage.CSVLoader() AS (id: chararray, case_no: chararray, date: chararray, block: chararray, iucr: chararray, primary_type: chararray, description: chararray, location_description: chararray, arrest: chararray, domestic: chararray, beat: chararray, district: chararray, ward: chararray, community_area: chararray, fbi_code: chararray, coordinate_x: chararray, coordinate_y: chararray, year: chararray, updated_on: chararray, latitude: chararray, longitude: chararray, location: chararray);

--remove the header record from the dataset
raw_data_chicago_headless = FILTER raw_data_chicago BY id != 'ID';

-- select only the required columns
data_chicago = FOREACH raw_data_chicago_headless GENERATE date, block, primary_type, description, location_description, arrest, domestic, district, year, latitude, longitude;

-- store the final data into another file
STORE data_chicago INTO '/user/cloudera/data/staging/crime/chicago' USING PigStorage(';');

%pig.query

data_chicago_group2 = GROUP data_chicago BY (year);
FOREACH data_chicago_group2 GENERATE group, COUNT(data_chicago) AS total_count;

%pig.query

data_chicago_group3 = GROUP data_chicago BY (primary_type);
grouped_data_primry_type = FOREACH data_chicago_group3 GENERATE group AS primary_type, COUNT(data_chicago) AS total_count;
sorted_data_primry_type = ORDER grouped_data_primry_type BY total_count DESC;
LIMIT sorted_data_primry_type ${top_n=5};

%pig.query

data_chicago_group = GROUP data_chicago BY (year, primary_type, arrest);
FOREACH data_chicago_group GENERATE group.year, group.primary_type, group.arrest, COUNT(data_chicago) AS total_count;

%pig.query

--filter out homicide data and calculate the number of homicides by year and district
homicide_group_chicago = FILTER data_chicago BY primary_type == 'HOMICIDE';
homicide_grouping_chicago = GROUP homicide_group_chicago BY (year, district);
homicide_year_dist_count_chicago = FOREACH homicide_grouping_chicago GENERATE group.year, group.district, CONCAT(group.year, group.district) AS key, COUNT(homicide_group_chicago) as total_count;

--filter out homicide data that led to an arrest and calculate the number of homicides that led to an arrest by year and district
homicide_arrest_group_chicago = FILTER homicide_group_chicago BY arrest == 'true';
homicide_arrest_grouping_chicago = GROUP homicide_arrest_group_chicago BY (year, district);
homicide_arrest_year_dist_count_chicago = FOREACH homicide_arrest_grouping_chicago GENERATE group.year, group.district, CONCAT(group.year, group.district) AS key, COUNT(homicide_arrest_group_chicago) as total_arrest_count;

--join the 2 datasets
join_records_chicago = JOIN homicide_year_dist_count_chicago BY key, homicide_arrest_year_dist_count_chicago BY key;

--calculate the percentage
aggregation_chicago = FOREACH join_records_chicago GENERATE homicide_year_dist_count_chicago::year AS year, homicide_year_dist_count_chicago::district AS district, (int)(((double)homicide_arrest_year_dist_count_chicago::total_arrest_count / (double)homicide_year_dist_count_chicago::total_count) * 100) AS percent;

--sort the aggregated data by district
sorted_aggregation_chicago = ORDER aggregation_chicago BY district;

--display the results
FOREACH sorted_aggregation_chicago GENERATE year, district, percent;

%pig.query

--filter out theft records that have led to an arrest
theft_data_chicago = FILTER data_chicago BY (INDEXOF(UPPER(primary_type), 'THEFT', 0) > -1) AND (arrest == 'true');

--select month and primary type
theft_data_projection_chicago = FOREACH theft_data_chicago GENERATE GetMonth(ToDate(date, 'MM/dd/yyyy hh:mm:ss a', 'America/Los_Angeles')) AS month, primary_type;

--group by month and primary type
theft_grouped_chicago = GROUP theft_data_projection_chicago BY (month, primary_type);

--perform aggregation
FOREACH theft_grouped_chicago GENERATE group.month, group.primary_type, COUNT(theft_data_projection_chicago) as theft_count;
